import './header.css'

class Header extends React.Component{
    render(){
        return(
            <>
            <div id="header">
                <h1 id="title">DailyForecast</h1>
                <input id="search" type="text" placeholder="Enter a city name to look forecasts. (for ex. 'Paris')" />
            </div>
            </>
        )
    }
}

export default Header
